import React, { Component } from "react";
import myImg from "./suleymantasci.jpg";
import "./Menu.css";
import {
  BrowserRouter as Router,
  Switch,
  Link,
  Route
} from "react-router-dom";
import About from "../Screens/About";
import Contact from "../Screens/Contact";

const routes = [
  {
    path: "/about",
    component: About
  },
  {
    path: "/contact",
    component: Contact
  }
];

export default class Menu extends Component {
  render() {
    return (
      <Router>
        <div className="menuContainer">
          <img className="img1" src={myImg} alt="Süleyman TAŞÇI"></img>
          <h2 className="myTitle">
            <a href="asd">Süleyman TAŞÇI</a>
          </h2>
          <ul className="menuItems">
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">Yetenek Ve Tecrübelerim</Link>
            </li>
            <li>
              <Link to="/portfolio">Portföy</Link>
            </li>
            <li>
              <Link to="/contact">İletişim</Link>
            </li>
          </ul>
          <Switch>
        {routes.map((route, i) => (
          <RouteWithSubRoutes key={i} {...route} />
        ))}
      </Switch>
          <ul className="menuSocials">
            <li>
              <a href="https://twitter.com/suleymntasci">Twt</a>
            </li>
            <li>
              <a href="https://www.linkedin.com/in/suleymntasci/">Lin</a>
            </li>
            <li>
              <a href="https://www.instagram.com/suleymntasci/">İns</a>
            </li>
          </ul>
        </div>
      </Router>
    );
  }
}
